using ShineEngine;

/// <summary>
/// 重新加入匹配队列消息(generated by shine)
/// </summary>
public class FuncReAddMatchResponse:FuncSResponse
{
	/// <summary>
	/// 数据类型ID
	/// </summary>
	public const int dataID=GameResponseType.FuncReAddMatch;
	
	public FuncReAddMatchResponse()
	{
		_dataID=GameResponseType.FuncReAddMatch;
	}
	
	/// <summary>
	/// 执行
	/// </summary>
	protected override void execute()
	{
		GameC.scene.onReAddMatch(funcID);
	}
	
	/// <summary>
	/// 获取数据类名
	/// </summary>
	public override string getDataClassName()
	{
		return "FuncReAddMatchResponse";
	}
	
	/// <summary>
	/// 读取字节流(完整版)
	/// </summary>
	protected override void toReadBytesFull(BytesReadStream stream)
	{
		base.toReadBytesFull(stream);
		
		stream.startReadObj();
		
		stream.endReadObj();
	}
	
}
